import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";

export default class Navigation extends Component {
 render(){
   return(
     <>
     <Container>
       <Navbar fixed="top" bg="light" variant="light" expand="lg">
         <Nav className="mr-auto nav-container-style">
           <Navbar.Brand href="#home">
             <img
              src="https://cdn2.vectorstock.com/i/thumb-large/06/96/logo-concept-icon-bat-man-dark-knight-vector-36030696.jpg"
              width="50"
              height="50"
              className="d-inline-block align-top"
              alt="Bat Management Logo"
             />
             <span className="nav-logo-font"><span className="nav-logo-purple">Bat</span>Management</span>
           </Navbar.Brand>
           <span className="nav-item-style">
             <Nav.Link>Home</Nav.Link>
             <Nav.Link>Contact</Nav.Link>
             <Nav.Link>Templates</Nav.Link>
            </span>
         </Nav>
       </Navbar>
     </Container>
     </>
  );}
}
